import axios from "axios";

export default {
    getBooks: function (q) {
        return axios.get("api/google", { params: { q: "title:" + q } })
        .then(bookRes => {
            bookRes.every( data =>
                console.log(data.volumeInfo.title)
            )
        });
    }
}
